【アスク ジャパンプレミアム バランスミール ササミ 600gの詳細】<br>
●厳しい品質検査をクリアした、プレミアムペットフードシリーズです。愛犬に不足しがちな栄養素をバランスよく配合し、食べやすい柔らかさ、大きさにこだわりました。<br>●わんちゃんの大好きなチーズの香りがするので、食いつきが違います。また小分けタイプなので毎日新鮮なおいしさを味わえます。<br>
※開封して残った場合には密封し、冷蔵庫で保管してください。<br>
●日本製の原料を使った安心安全、さらにバランスの摂れた食事をぜひ食べさせてあげてください。<br><br>

【原材料】<br>
小麦粉、植物タンパク、鶏肉、コーンフラワー、ビーフオイル、小麦グルテン、野菜類(さつまいも、粉末にんじん、粉末ほうれん草、粉末トマト)、粉末チーズ、フィッシュパウダー、ｙ-リノレン酸、増粘安定剤(プロピレングリコール)、ミネラル類(Ca、P、Na、Cl、Mn、Zn、Cu、l、Co)、チーズフレーバー、保存料(ソルビン酸K、デヒドロス酸Na)、乳化剤、クエン酸、ビタミン類(A、D3、B2、B12)、オリゴ糖、リンゴ酸、グルコサミン、アミノ酸(メチオニン)<br><br>

【栄養成分】<br>
粗たんぱく質：15.5％以上、粗脂肪：4.5％以上、粗繊維：1.5％以下、粗灰分：6.0％以下、水分：30.0％以下<br><br>

【賞味期限】<br>
パッケージに記載<br><br>

【内容量】<br>
600g（100×6袋）<br><br>

【販売元】<br>
アスク<br>
東京都中央区銀座2-8-19<br>
お電話：03-5159-7223<br><br>

【商品区分】<br>
ペット用品<br><br>

